window.bookSummaryJSON = "<p>Rain's family has summoned her and if she doesn't turn up, they intend to use her little sister in a dangerous ritual.</p> <p>Rain know she can handle the magic. The problem is extracting herself from New Orleans afterwards.</p> <p>Luckily, the alpha female of the Wyvern Pride owes her a favour or 10.</p> <p>When Luke is sent to Nola as one of Rain's bodyguard, his instincts tell him that the witch is far more powerful than she appears to be.</p> <p>One ritual goes wrong, showing him just how right he was.</p>"; 
